layouts
A third-party plugin that we configure to use the Tiny Liquid templating engine. This is what adds meaning to the "layout" property attached to each HTML file in Metalsmith memory.
This plugin is what uses the data from each page in Metalsmith memory to produce actual HTML page content.
For instance, if this was the "files" data in Metalsmith memory -
{
"some/example/index.html": {
layout: "page/drupal.liquid",
title: "Example",
contents: ''
},
// ... thousands more
}
Then it would be configured to use page.drupal.liquid as its top-level Liquid template. Its "contents" property would contain the HTML result of the templating.
